int solve(void) {
	int n;
	int i, j;
	rect_t rects[50];
	int count;
	if (scanf("%d", &n) != 1 || n == 0) return 0;
	za_init(&za_x);
	za_init(&za_y);
	za_reg(&za_x, -2000000);
	za_reg(&za_x, 2000000);
	za_reg(&za_y, -2000000);
	za_reg(&za_y, 2000000);
	for (i = 0; i < n; i++) {
		if (scanf("%d%d%d%d", &rects[i].l, &rects[i].t,
		&rects[i].r, &rects[i].b) != 4) return 0;
		za_reg(&za_x, rects[i].l);
		za_reg(&za_x, rects[i].r);
		za_reg(&za_y, rects[i].t);
		za_reg(&za_y, rects[i].b);
	}
	za_setup(&za_x);
	za_setup(&za_y);
	field_init();
	for (i = 0; i < n; i++) {
		int l = za_get(&za_x, rects[i].l) * 2;
		int r = za_get(&za_x, rects[i].r) * 2;
		int t = za_get(&za_y, rects[i].t) * 2;
		int b = za_get(&za_y, rects[i].b) * 2;
		field_line(l, t, r, t);
		field_line(l, b, r, b);
		field_line(l, b, l, t);
		field_line(r, b, r, t);
	}
#if 0
	for (i = 0; i < MAX_SIZE; i++) {
		for (j = 0; j < MAX_SIZE; j++) {
			printf("%d",-field[i][j]);
		}
		puts("");
	}
#endif
	count = 0;
	for (i = 0; i < MAX_SIZE; i++) {
		for (j = 0; j < MAX_SIZE; j++) {
			if (!field[i][j]) {
				count++;
				field_paint(j, i);
			}
		}
	}
	printf("%d\n", count);
	return 1;
}
